import './Blog.css';
function Blog() {
    return (
        <div className="blog">
            <img src="https://res.cloudinary.com/diqqf3eq2/image/upload/v1595959131/person-2_ipcjws.jpg" alt="img"/>
            <div>
                <h5>Betie john</h5>
                <span>29 years</span>
            </div>
        </div>
    )
};
export default Blog;
